import React from "react";
import Header from "./Header";
import Containter from "./Container";
import Footer from "./Footer";
import "../../public/css/base.css";
import "../../public/css/main.css";

const Home = () => {
    return (
        <>
            <Header />
            <Containter />
            <Footer />
        </>
    );
};

export default Home;
